"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[852],{852:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"சான் மத்தேயோ கவுண்டி பெருமை மையம்","description":"சான் மத்தேயோ கவுண்டி பெருமை மையம் ஒரு இணையான மாதிரி அமைப்பு முனையே ஒரு நிறுவனமாகும் மற்றும் LGBTQ+ சமூகத்துக்கான ஒரு கணினிப் பொருட்காட்சியாகும். எமது சமூக உறுப்பினர்களுக்கு பயிற்சி, சமூக நிகழ்வுகள், சக ஆதரவு குழுக்கள், நாள்தோறும் நிகழ்வுகள், மன சார்பரி, மற்றும் வழக்கு மேலாண்மை ஆகியவற்றை ஆதரிக்க சக்திவாய்ந்த திட்டங்கள் மற்றும் சேவைகளை வழங்குகின்றோம்."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"தன்னையே செயலாக்கும் ஹார்மோன் மாற்று சிகிச்சை (HRT) ஆர்வத்தை வைத்திருக்கும் நபர்களுக்கான அறிவு மையமாக உள்ள மிகுந்த ஆன்லைன் சமூகம். அவர்களின் இணையத்தளம் தனியார செயலாக்கும் HRT க்கு தகவல்களை, வளங்களை, ஆதரவை அணுகுவது என்பது எங்கும் பாதுகாப்பான மற்றும் சேர்ந்து வாழ்வது என்பது என்று ஈர்த்தெழுதுகிறது. நீங்கள் மாற்று முறைகளை ஆராய்கிறீர்களா, மதிப்பீடு மற்றும் செயல்பாட்டில் வழிகாட்டுதலை தேடுகிறீர்களா, அல்லது ஒரே அனுபவத்தை பகிர்ந்து கொண்ட பிறருடன் தொடர்பு கொள்ள விரும்புகிறீர்களா, DIYHRT.cafe உங்கள் ஆரோக்கியம் மற்றும் நலன் பற்றிய அறிவியல் ஆக்கப்பட்ட முடிவுகளை எடுக்க உதவும் மிகுந்த முக்கியத்துவமுள்ள ஞாலங்களை, தனிப்பட்ட கதைகளை மற்றும் வல்லுநர் ஆலோசனைகளை வழங்குகிறது."},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"ஒட்டுண்டு மற்றும் ஆயிரங்கொல்லுதல் மீண்டும் உயரும் ஆளுக்கான NSW சேவை","description":"STARTTS ஒரு சிறப்புச்சேர்ந்த, முன்னாட்சி அல்லாத அமைப்புக் கலாச்சாரத்துக்கு பொருத்தமான உளவியல் சிகிச்சை, ஆதரவு, மற்றும் சமுதாய வலைவில் இருந்து உயிரை வீசிய மற்றும் ஆயுதக்கேடு மிகுந்தவர்கள் அவர்களின் வாழ்க்கைகளை ஆஸ்திரேலியாவில் மீண்டும் கட்டிமேல் சேர்வதை உதவுவதாகும். அவர்கள் அகதியர் மற்றும் மிகுந்தவர்களின் பின்னணியில் இருந்து வந்த பாலுண்மைவியலாளர்களையும் ஆதரவு செய்கின்றனர்."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"பெண்களிலிருந்து ஆண்களுக்கு (FTM) மாறிவரும் நபர்களை ஆதரிக்கவையாகவே எந்தனைத் தளத்துக்காக உருவாக்கப்பட்ட FTMGuide.org. அவரது இணையதளம், ஒரு நம்பிக்கையுள்ள வளமாக சேவிக்கின்றது, தமின் FTM பயணத்தில் பயணமாகும் தேவைக்கு ஏற்ப அதிகமான தகவல், வழிகாட்டல், மற்றும் சமூக இணையங்களை வழங்குகிறது. ஹார்மோன் சிகிச்சை மற்றும் அறுவை விருப்பங்கள் மீதான நடைமுறை ஆலோசனைகளிலிருந்து ஆரோக்கியக்கல்வி ஆதரவு மற்றும் தனிப்பட்ட கதைகள் வரை, FTMGuide.org நபர்களை அவர்களுக்கு தேவையான அறிவு மற்றும் வளங்களுடன் உரிமைகொள்ள அவர்களின் மாற்றத்தை தனிப்பட்ட மற்றும் தெளிவான வழியில் வழிநடத்த நோக்குகிறது."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"பனிமின்மட்டும் மற்றும் அவிசெயல்பாட்டு சமுதாயத்துக்கான ஆதாரமான ஆய்வு, கல்வி மற்றும் வளங்களை வழங்குவதற்க்கு சித்தார்த்த முளவிய ஆன்லைன் மேடை, தனிப்பட்டும் பெண்ணாக்கும் ஹார்மோன் சிகிச்சை (FHT) மேல் சிப்பனுள்ளது. அவரது வலைத்தளம் FHTயின் மருத்துவ, உடல்நல, மற்றும் உளவியல் தகவல்களுக்கான விழாய்மான மையமாக சேவை செய்கிறது. அவரது நண்பர் மதிப்பியல் ஆய்வுகள், அறிஞர் கட்டுரைகள், மற்றும் நடப்பு வழிகாட்டிகளின் விரிவான சேகரிப்புமூலம், அவரது தளம் தன்னார்வலர்ச்சி மற்றும் ஆரோக்கியத்தை குறித்த அறிவுறுத்தப்பட்ட முடிவுகளையேற்பதற்கு மக்களை அதிகாரப்படுத்துகிறது."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"பாலியல் குழப்பத்தை குறித்து அறிவு, ஆதரவு, மற்றும் புரிந்துணர்வு தேடும் நபர்களுக்கான நம்பிக்கையான ஆன்லைன் வளாகம். அவர்களது வலைத்தளம் தனிநபர்களின் பயணத்தில் அவர்களை ஆதரிக்க ஒரு பொதுவழிக் கேள்விகள், வளங்கள் மற்றும் சமூக இணைப்புகள் ஆகியவற்றை ஏற்படுத்துவதாக உள்ளது. பாலியல் அடையாளம் மற்றும் மாற்றத்திலிருந்து முழுமையான வழிகாட்டிகள், தனிப்பட்ட கதைகள் மற்றும் வல்லுநர் ஆலோசனைகள் வரை, அவர்கள் அனைத்துக்கும் பாலாண்மையான மற்றும் சேர்ந்து இருக்கும் இடத்தை உருவாக்க முயற்சிக்கின்றனர்."},{"id":"3f865b77-21e6-472e-be98-b2cfd999dafb","slug":"unitarian-universalist-association","externalUrl":"https://www.uua.org/","tags":["non-binary","support-groups","education-awareness","spiritual"],"address":"24 Farnsworth St, Boston, MA 02210, USA","phoneNumber":"(617) 742-2100","country":"US","provinceOrState":"MA","city":"Boston","county":"Suffolk County","latLng":[42.35163259999999,-71.04857050000001],"email":"info@uua.org","socialMedia":null,"title":"யூனிட்டேரியன் யூனிவெர்ஸலிஸத் அசோசியேஷன்","description":"நீதி, அன்பு, அறிவெல்லாமில் முன்னேறும் மனிதர்களை ஆதரிக்கும் திறந்த மனதுடன், முதன்முதலில் ஆத்யாத்மிகம் அமைப்பு. இந்த சமூகம் மேலும் முறைசேர்க்கை அரசியற் சமுதாயத்தை உள்ளடக்கிய வேவைக்களாக பல்வேறு வகையான மக்களை அன்புடன் ஏற்றுக்கொள்கின்றது. அவர்கள் மேலும் விவித சமூக விஷயங்களுக்கான வளங்கள், ஆதரவு மற்றும் மேலேற்பதற்கான முயற்சியை வழங்குகின்றனர்."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Movement Advancement Project","description":"மூவ்மெண்ட் அத்வான்மென்ட் ப்ரொஜெக்ட் (MAP) ஒரு சுய மையமான, முக்கியமற்ற ஆலோசனை மேலாண்மை நிறுவனமாகும். அது கடுமையான ஆராய்ச்சி, உண்மை, தொலைத்தொடர்பு மற்றும் அனைவருக்கும் சமமான வாய்ப்புகளை அதிவேகமாக ஏற்படுத்தும் உதவியை வழங்குகிறது. MAP உடல்நலம் மற்றும் மகிழ்ச்சியைப் பின்தொடர்புகொள்ள, வாழ்க்கையை வளர்க்க, அவர்கள் விரும்பும் அனைத்து ஆதரவை பெற காத்திருப்பவர்களை பராமரிக்க, அவர்கள் சமுதாயத்தில் பாதுகாப்பாக இருக்க, நாடாளுமன்ற வாழ்க்கையில் பங்கேற்க வேண்டிய அனைத்து மக்களையும் உறுதி செய்யும் பணியில் ஈடுபத்துகிறது."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"ஜோர்டன் ரோஸ் தொடர்பு சேவைகள்","description":"ஜோர்டன் ரோஸ், பாலின மாற்றத்தைக் கொண்ட மக்களுக்கு பேச்சு, குரல் மற்றும் தொடர்பு கல்வி வழங்குகிறார். அவர் 1-மேல்-1 கல்வி, ஆன்லைன் வகுப்புகள், நிகழ்வுகள், மற்றும் \'வாய்ஸ் விதின் கோச்சிங் நிரல்\' வழங்குகின்றார். அவரது முறைக் கலைநெறியாளர்தகையான நிர்மாணத்தை, நிகருத் ஆற்றல் கலை சிகிச்சையை, யோகா மாணவர் வழிகாட்டலை, மற்றும் மூச்சு நிலைப்பாடுகளைக் கொண்டு, தொடர்பின் உடற்கையேனும் ஆலோசிக்க மற்றும் மனத்தையும், உண்மையான மற்றும் ஆற்றலான பகுதிகளையும் முடிவுக்கு அழைக்க முயற்சி செய்கின்றார்."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"ஜென்டர் டைனாமிக்ஸ் ஆன்லைன் கல்வி போர்ட்டல்","description":"ஜென்டர் டைனாமிக்ஸ் என்பது ஐரோப்பிய மையமான அலாபரிசி அமைப்புச் சார்பு கொண்டது, இது தென் ஆப்பிரிக்காவில் மற்றும் தென் ஆப்பிரிக்காவில் உள்ள டிரான்ஸ் மற்றும் பாலினர் வளர்ச்சி சமூகங்களின் மாநுட உரிமைகளை வளர்ப்பது, முன்னேற்றுதல், மற்றும் பாதுகாப்பு அமைப்பு அமைப்பு. அமைப்பு வலைவரி, இயக்குதல் மற்றும் நேரடி சேவைகளை சமூகத்திற்கு வழங்குகிறது. அவர்கள் உடல்நலம், கல்வி நிகழ்வுகள், மற்றும் சட்டவிரோத பாலினர் அங்கீகாரத்தை குறித்த ஆன்லைன் வளங்களையும் வழங்குகிறார்கள்."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Sylvia Rivera Law Project (SRLP)","description":"Sylvia Rivera சட்ட திட்டம் அனைத்து மக்களும் வருமானம் அல்லது இனவாதியாக இருப்பதின் அலப்பரமாக, சுடச்சூழல், வேலைநீக்கம் அல்லது வன்முறை எதிர்கொள்வதின்றி, தங்களின் பாலினம் அடையாளத்தையும் வெளிப்பாட்டையும் தனித்து முடிவுக்குரியதாக உறுதி செய்வதற்கான வேலைகளை நிறைவேறுகின்றது. SRLP சட்டப்பொருள் உதவி,பிரச்சினைகளையெயப்பது, பயிற்சிகளையெய்துதல், மற்றும் ஒரு சிறை ஆலோசக விவகார சபைக்கு ஒழுங்கு வைப்பது. சமூக ஈடுபாடு நாணய நிதியுரிப்புகள், தொண்டர்களாக விருப்புள்ளவர்கள், மற்றும் சபை உறுப்பினர்களின் மூலம் ஊக்குவிக்கப்படுகின்றது."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"காலையில் ஏரின்","description":"பாலின சட்டங்கள் மற்றும் வாழ்க்கை பற்றிய செய்திகள் மற்றும் விவாதம். ஏரின் ரீட் மூலம் · 38,000 க்கும் மேற்பட்ட சந்தாதாரர்கள்"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"உலக முழுவதும் சமமான அறிகுரலை பரப்பவும் ஒரே நேரத்தில் மேம்பட்டதாக இருமருமான மூல ஊழியத்தை உருவாக்குவதை நோக்கி ஒரு முதன்முதலான ஆன்லைன் மேடையாக இருக்கின்றது. அவரது இணையதளம் உலக முழுவதும் இருக்கும் சட்டங்கள், கொள்கைகள் மற்றும் சமமான உரிமைகளுக்கு சமூக அழிப்புருக்களை மதிப்பிடுகின்ற கேண்ட்ரலைஸ் டேட்டாபேஸை வழங்குகின்றது. சமத்துவ, ஆக்கப்பூர்வமான, மற்றும் சட்ட பாதுகாப்பைப் பார்த்திருக்கும் தரவை வரைபடத்தால் மற்றும் மாறுபாடுகளை வரையவும், EqualDex.com செயலாளர்களுக்கு, ஆராய்ச்சியாளர்களுக்கு, மற்றும் உலக அளவில் சமமான உரிமைகளுக்காக ஆதரவளிக்கும் விருப்புவாய்ஞ்சகளுக்கு ஒரு சக்திவாய்ந்த கருவியாக இருக்கின்றது. அவரது தொடன்படத்தலாகும் வரைபடங்களை ஆராய்ந்து பார், நாட்டைப் பிரிய சுவாரஸ்யமான விபரங்களை உலவு, மற்றும் உலக முழுவதும் சமமான உரிமைகளைப் பொறுத்தும் சமூகத்தின் அண்மைய மேம்பாடுகள் மற்றும் சவால்களை அறிய."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"ஸ்ட்ரான்ஸ் ஃபார் டிரான்ஸ், முதலியவற்றில் உள்ள முழுவதும் உலக அளவில் மூடி, அழகு, மற்றும் ஆரோக்கியத்தில் உள்ள தொழில்துறைகள் மற்றும் அமைப்புகளின் வலையமைப்பேது. அவை அனைத்து விருந்தினர்களுக்கும், குறிப்பாக டிரான்ஸ் சமுதாயத்தில் இருந்து வரும் விருந்தினர்களுக்கும், பாதுகாப்பான மற்றும் நேர்ம அனுபவங்களை உருவாக்குவதற்கு மற்றும் அதை ஊக்குவிக்குவதற்கு முயல்கின்றன."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Pacific மனித வளர்ச்சி மையம்","description":"1973ஆம் ஆண்டில் தொடக்கப்பட்டதாக, Pacific மனித வளர்ச்சி மையம் Bay பிரதேசத்தில் மிகவும் பழைய LGBTQIA+ மையமாகும், தேசிய நிலையில் மூன்றாவது மிகவும் பழையதாகும், மேலும் அது Alameda மாவட்டத்தில் LGBTQIA+ மற்றும் QTBIPOC மக்களுக்கும் அவர்கள் குடும்பத்தினருக்கும் மட்டும் மாற்று மதிப்பு மன சுகாதார மருத்துவமனையை இயக்குகிறது."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"ஓக்லாந்து பிராசம்பிய அறிமுக இடம்","description":"ஓக்லாந்துவின் முதன்முதலாகவும் அனைவருக்கும் வழங்கும் அரசு அங்கீகரித்த 501c3 பிராசம்பிய அறிமுக இடம். வழங்கியுள்ள சேவைகள் ஆதரவு குழுக்கள், மன நலச் சேவைகள், வீட்டுநிலை உதவி, இளைஞர் நிகழ்ச்சி, சட்ட மேலாண்மை நிறுவனம், உணவு அடையாளங்கள் முதலியவற்றை உள்ளடக்கி உள்ளன. முதியவர் பிராசம்பிய மக்களுக்கும், பிராசம்பிய சமூக உறுப்பினருக்கும் சிறப்பு நிகழ்ச்சிகள் நடைபெறுகின்றன."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"பால் வகைப்பாடு","description":"பால் வகைப்பாடு என்பது அனைத்து பாலுக்கான அடையாளங்கள் மற்றும் வெளிப்படைத்தல்களுக்கான குழந்தைகள் மற்றும் வாழ்க்கையாளர்களின் நலம் மேம்படுத்தும் மூலம் கல்வியாளவு, விழிப்புணர்வுக் கூர்மையாக்கி, மனித அனுபவங்களின் விரிவான வீச்சில் அறிவீடு வழங்குகிறது. நாம் மேலும் பல்லூட்டியல் மற்றும் பாலுக்கான விவாதிப்பான சூழல்களை பள்ளிகள், விளையாட்டு அணிகள், வேலை சூழலுக்குக் கொண்டுவந்து, மற்றும் மருத்துவ வழங்குநர்களால் உருவாக்குவதற்கு உதவுகின்றோம்."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"தேசிய மாறுபாலி சமமானத்துவ மையம்","description":"தேசிய மாறுபாலி சமமானத்துவ மையம் என்பது மாறுபாலி மக்களை மேலும் உண்மையில் அறிய மற்றும் ஏற்றுறுத்தல் கிடைக்க விதிகள் மற்றும் சமூக முன்னோக்கி மேல் ஆதரவு கொடுத்து, மாறுபாலிக் குழு என்ற சமூகத்தின் மேல் விளைவிக்கும் பிரச்சினைகளுக்கு பற்றி தகவல்கள் வழங்குவதாகும் ஒரு அமைப்பு. அதில் முதுமையாக உள்ளது, வன்முறை எதிர்ப்பு, வேலை, குடும்பங்கள், சுகாதாரம் & HIV, வீடு & விழிப்புணர்வு, மேலும் பல."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"இன்னர் சர்க்கிள்","description":"ஆன்மீகத்துவம், கல்வி மற்றும் இயக்கத்தை மூலம் பாலின அந்தர்த்தனை மற்றும் பாலியல் அடையாளம் ஆதாரமாக மதிக்கப்பட்ட முஸ்லிம்களுக்கு குணமாக்குவதை நோக்கி உலக முஸ்லிம் சமுதாயத்தை இலக்குவதற்கு இயங்கும்"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"ஃப்ளோரிடா பெயர் மாற்றத் தமிழில்","description":"இந்த வலைத்தளம் ஃப்ளோரிடாவில் தங்களது பெயர் அல்லது பாலின்கணத்தினைப் புதுப்பிக்க விரும்பும் நபர்களுக்கு படி முதல் படி வழிமுறையை வழங்குகிறது. அதில் நீதிமன்றத்தில் மனுவைக் கோப்பிடுதல், சமூக பாதுகாப்பு அட்டை, ஓட்டுனர் உரிமத்தைப், பாஸ்போர்டை மற்றும் பிறப்புச் சான்றிதழை புதுப்பிக்கும் படிகள் உள்ளன."},{"id":"9e09fcfd-eb5b-4dd9-825c-ae3c3c5ce940","slug":"trans-lifeline-peer-support-and-resources","externalUrl":"https://translifeline.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships"],"address":null,"email":null,"phoneNumber":"(877) 565-8860","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TransLifeline/","twitterUrl":"https://twitter.com/TransLifeline","instagramUrl":"https://www.instagram.com/translifeline/?hl=en","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Trans Lifeline","description":"Trans Lifeline ஒரு மாற்று முன்னணி நிறுவனமாகும், மாற்றுநை சமுதாயத்துக்கான நண்பர் ஆதரவு மற்றும் வளங்களை வழங்குகின்றன. சமூக ஆதரவு, மைக்ரோவழங்கிகள் மற்றும் ஒரு ஹாட்லைன் மேல் கவனமிட்டு, அவர்கள் மாற்றுநை ஆதரவுபெற வேண்டிய வேண்டிய இணைப்புகள் மற்றும் வளங்களை வழங்க நோக்குகின்றன. Trans Lifeline மாற்று சமுதாயத்திற்காக #SafeHotlines போன்ற முயற்சிகள் மூலமும் மேலதிக ஓரளவு வழங்குகின்றது."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"ட்ரெவர் திட்டம்","description":"ட்ரேவர் திட்டம் அமெரிக்கத்தில் உள்ள முனையில்லா அமைப்பு, LGBTQ+ இளம் இளைஞர்களுக்கு மூக்குவிபரித்தல் தடுப்பு சேவைகளை வழங்குகின்றது. இந்த தளம் தற்போதுள்ள ஆபத்தியில் உள்ளவர்களுக்கு மற்றும் மூக்குவிபரித்தல் தடுப்பு முயற்சிக்கு, TrevorChat, மற்றும் TrevorText ஆகியவற்றின் மூலம் ஆதரவு வழங்குகிறது, மன நலத்தை மேம்படுத்த வழிகாட்டுதல்களின் மூலம் மற்றும் சமூக சேவைகளுக்கு மற்றும் ஆதரவு குழுக்களுக்கு மதிப்புள்ள ஆதாரங்களை வழங்குகிறது."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"மார்ஷாக்கான இடம்","description":"மார்ஷாக்கான இடம் ஆகியவை, ஆதிகமான அபாயங்களுக்கு இருப்புவதிலிருந்து பாதுகாப்பான இடத்தில் டிரான்ஸ் நபர்கள் மற்றும் குடும்பங்களுக்கு உதவ நோக்குகின்றன. தேசத்தின் சுற்றுலாவில் முரண்டிய அண்டிரான்ஸ் சட்டங்களுக்கு எதிராக மார்ச், 2023ம் ஆண்டுக்கு அதன் பயணத்தை தொடங்கி. இப்போது APFM சிவப்புநில மாநிலங்களிலிருந்து அகதிகளை ஒரே வீட்டிற்கு ஒரு நண்பரின் வேண்டுவதைப் பொருத்துவதில் கூற்றுத் தழுவுகின்றது, மிகவும் கவனமாக ஒரே வீட்டாக."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"நல்ல நம்பிக்கை மெட்ரோபாலிட்டன் கம்யூனிட்டி சர்ச்","description":"இயேசு கிறிஸ்துவின் கொள்கைகளின் மேல் உருவாக்கப்பட்ட, கிட்டத்தட்ட ஜனாதிபதியாக மேம்பட்ட கிறிஸ்துவ ஆழ்ந்த சமூகமாய உள்ளும். இவை வேறுபாட்டைக் கொண்டாடுகின்றன, எல்லாருக்கும் வரவேற்பு அளிக்கும் பாதுகாப்பான, முக்கியமாக மாணவர்களுக்கான இடத்தை வழங்குகின்றன. இது கேப் டவுன், தென்னாப்பிரிக்காவில் செல்லலாகிய கிறிஸ்துவ ஆழ்ந்த சமூகத்தின் ஒரு பகுதியும், மெட்ரோபாலிட்டன் கம்யூனிட்டி சர்ச்சிகள் (MCC) என்ற பெரிய சர்வதேச மதிப்புத்திறனையும் உள்ளது."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons முன்னும் பெண்ணாக, ஆணாக அல்லது ஆண்பெண் ஆக குரல் கட்டுப்பாட்டை மேம்படுத்த விரும்பும் மாற்று-பால் மற்றும் இணையரீதியான நபர்களுக்கு தரத்து கட்டுப்பாட்டை மற்றும் விடுதலை சேவைகளை வழங்குகிறது."},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"தசை மையம் இன்க்.","description":"தசை மையம் இன்க். பல்வேறு தனிப்பட்ட சேவைகளை வழங்கி, தசை அடையாளத்தை ஆராயும் மேலாண்மைக்கு ஆதாரமளிக்கின்றது மற்றும் தசை முனைப்பை இளைப்பதில் உதவின்றது. அவர்கள் உண்மையான தன்னை ஆராயும் மற்றும் வாழ்ந்து கொண்டிருக்கும் பயணத்தின் ஒவ்வொரு நிலையிலும் அது மாறிப்பாட்டு மற்றும் தசை இயற்பாடு மக்களை ஆதரிக்கின்றது. அது குடிசை, வழிவகுக்கum் மேலாண்மை, கல்வி & பயில்ட்டுவக்கும், ஆலோசனையும் மாநகிக சுவாரஸ்திர சேவைகளும், குழுக்களும், செய்திகளும், வளங்களும் வழங்குகின்றது."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"உலகெங்கும் முற்றுகேடு மற்றும் வன்முறைக்கு இருக்கும் LGBTQ+ நிறுவனங்களுக்கு உதவி மற்றும் சார்ந்தோர் என்பவர்களை தனிப்பட்ட மின்னணு மேடையாக அமைந்துள்ளது. தனக்குள் நிறுத்தாமையான முழுமையுடன், இந்த வலைத்தளம் உடனடியாக ஆபத்தில் இருக்கும் ஆதாரங்களுக்கு, அவர்களைத் தொடர்கதைக்கு இணைக்கின்றது, அவர்களுக்கு அவர்கள் மேற்பாடு அவர்களை அப்பத்தியிலிருந்து மேலே ஏற்றுவைக்கும் வழிமுறைகள் மற்றும் ஆதாரத் துணையை வழங்குவதாகக் கொண்டிருந்தால். உள்ளூர் நிறுவனங்களுடன் கூட்டுப்பாடுகள் மற்றும் ஏகப்பட்ட ஆதரவுள்ள வலையமைப்புகளுக்கு மூலம், RainbowRailroad.org துண்டுதடுமாறு முழுமைப்படுத்திய ஆலோசனையை, சட்டப்பேரவையை, மற்றும் மாற்று ஆதரவை வழங்குகிறது, இப்படியே ஆதாரங்களுக்கு முற்றுகேடு என்பனை விட்டு முதன்முதலில் செலுத்த வேண்டியவர்களுக்குக் காவலனாக செல்வதாகக் இருக்கும். RainbowRailroad.org முக்கியமாகக் கொண்டிருப்பது மனித உரிமைகளை, வாழ்க்கையை காப்பாற்றுவதை, மற்றும் இன்னும் ஆக்கப்பொருளான உலகை வழங்குவதை, ஆகியே சேர்ந்துகொண்டுள்ளது பொறுப்பாகக் கொண்டிருப்பது, முதிரை மக்களுக்கு அரசியலும் மற்றும் சுதந்திரத்தைக் கேட்டுவார்."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"மெக்கென்சி திட்டம்","description":"பாலின நீதியை மேம்படுத்துவதை இலகுவாக்குவதற்கும், மாறுபாலியாகக் குறிக்கப்பட்ட சமுதாயத்தை சேவைகூடாதிகாக்குவதற்கும் குறியேற்றும் சேவைகள், நிகழ்வுகள் மற்றும் நிகழ்வுகளை உள்ளடக்கிய ஒரு கூடுதலான வளங்கள். மருத்துவ சேவைகள், சட்ட உதவி, மானசிகச் சுகாதார சேவைகள் மற்றும் மேலும் ஆகியவற்றை உள்ளடக்கியுள்ளது."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"கிழக்கு பே மாறுபட்ட பாலினத்தை அடிப்படையாக ஏற்கும் & கோயில் ஆலோசனை","description":"கிழக்கு பே மாறுபட்ட பாலினத்தை அடிப்படையாக ஏற்கும் & கோயில் ஆலோசனை, சார்ந்த முதுகேலை ஆன சேவைகளை உள்ளடக்கியுள்ளது: தனிப்பட்ட ஆலோசனை பெர்க்லே, CA-வில் மையக்குவியலில் இருத்தல் பாலின ஆராய்ச்சி மற்றும் மாற்றத்தின் வழியாக ஆதரவு ஆற்றல் மற்றும் அறுவை சிகிச்சைக்குரிய அறிவிப்பு கடிதங்கள் மானசிக ஆரோக்கிய வழங்குபவர்களுக்கு, மாணவர்களுக்கு, ஊழியர்களுக்கு தொழில்நுட்ப பயிற்சி. சேம் டேவிஸ மாறுபட்ட பாலினத்தின அடிப்படையில் ஏற்கனவே உள்ளவர், ஆதாரம் இல்லாத பாலினத்தை அடிப்படையாக ஏற்கும் சமூக சேவை அலுவலர் (LCSW) மாறுபட்ட பாலினத்தின அடிப்படையில் ஏற்கும், ஆதாரம் இல்லாத பாலினத்தின அடிப்படையில் ஏற்கும் பள்ளியோட்டிகள் மற்றும் பாலை மாற்றிய இளம் மருந்து ஆராய்ச்சியுக்காக பணியாற்றுவார். அவர்கள் கிழக்கு பே மானசிக ஆரோக்கிய வழங்குபவராக 16 ஆண்டுகளிலும் அதிகமான அனுபவம் உள்ளனர், இது சமூக கல்வி மற்றும் மக்கள் ஆதரவு குழு நடத்தல், LGBTQI மாநாடுகளில் சமூக கல்வி மற்றும் அலமிடா கவுன்டியில் மிகப்பெரிய தொழில்நெறிகளுக்கு மன நேரடி ஆலோசனையிடும் 9 ஆண்டுகளும் உள்ளன. அவர்கள் நீண்ட கால அவஸ்தையில் மிக அதிகமாக ஆதரிக்கப்பட்டவர்களின் பக்கத்தில் ஒரு பலமான மற்றும் மேலும் அமைத்துவைக்கும் ஆதரவாளர்."},{"id":"e51c019c-8dfe-498e-b82e-4263a8f747e8","slug":"equality-florida","externalUrl":"https://www.eqfl.org/","tags":["legal","healthcare","education-awareness"],"address":null,"country":"US","provinceOrState":"FL","city":"St. Petersburg","county":null,"latLng":null,"email":null,"phoneNumber":"813-870-3735","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/equalityfl/","twitterUrl":"https://twitter.com/EqualityFlorida","instagramUrl":"https://www.instagram.com/equalityfl/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Equality Florida","description":"பாதுகாப்பான மற்றும் ஆரோக்கியமான பள்ளிகளுக்கு, LGBTQ சுகாதார சமமிக்கை, HIV முன்னேற்பாடு, LGBTQ பாதுகாப்பும் பலவற்றுக்கு முன்னேற்பதில் உழைப்புப் பெரும் பிளோரிடாவின் LGBTQ முன்னேற்பாடு அமைப்பு. இந்த அமைப்பு விவித நிகழ்வுகளை நிறுவுகின்றது மற்றும் மிகப்பெரிய சமத்துவ ஆதரவுகளைப் பெற்றுள்ளது, பாலின மாற்று சுகாதார மானுடர்களுக்கு அவசியமான உதவியைவிட்டு."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub என்பது NSW மாநிலத்தில் உள்ள எல்லா பாலின மாற்றை அனுபவிப்பவர்களுக்கு, அவர்களின் அன்பில் உள்ளவர்களுக்கு, ஆதரவாளர்களுக்கு மற்றும் சுகாதார வழங்குநர்களுக்கு உள்ள மின்னணுவியல் தகவல் மற்றும் வள மேலாண்மை மேலாய். அது அவர்கள் வளர்நதோ அல்லது அவர்களின் உண்மையான மெல்லிசைகளுக்கு வளர்ந்தபோது அவர்களுக்கு அளிக்கப்படாத தேவைகளுக்கு அணுகுமுறையை வழங்குகிறது. தகவல் மருத்துவ தேவைகளில் இருந்து ஆரம்பித்து ஹார்மோன்கள், அறுவை சிகிச்சைகள் மற்றும் டாக்டர்களின் பட்டியல்கள், சமூக மற்றும் சட்ட பிரச்சினைகள் வரை மிகுந்துவிதமாக உள்ளன."},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"Twenty10 உள்ளிட்ட GLCS ஆகியன வாழ்கையை மாற்றிய பல்வேறு சேவைகளை லெஸ்பியன், கேலி, இருபால்காமியாக அழைக்கப்படுகின்ற, மாற்றுப் பாலினமாக அழைக்கப்படுகிறது, கலைஞர், கீராக, காமத்துக்கு ஆஸையற்றவர் அல்லது அவர்கள் அடையாளத்தை கேள்விப்பதற்கு NSW மாநில மாணவர்களுக்கு வழங்குகின்றது. அவர்களின் சேவைகள் நுழைவுக்கும் மதிப்பைப் பொருத்துதல், வீட்டாக மற்றும் வழக்கு மேலாண்மை, ஆலோசனை, சமூக ஆதரவு திட்டங்கள், மற்றும் LGBTIQA+ அணுகுமுறைத் தரப்பு"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"பாலின மாற்று வரைபடம்","description":"Transgendermap.com என்பது பாலின் அடையாளத்தை சந்தேகிக்கும் அல்லது பாலின மாற்று வரியாவில் உள்ள மக்களுக்கு பிரயோகக் கூறுகள் மற்றும் வழிகாட்டுதல்களை வழங்குவதை நோக்கி ஆன்லைன் வளமாக உள்ளது. இந்த இணையத்தளம் பாலின் மாற்று சொற்தகவல்களை உணர்வத், மாற்றம் செயல்முறைகள், சட்ட விவாதங்கள், சுகாதார, பல தனிப்பட்ட கதைகள் போன்ற பல தலைப்புகளைக் கொண்டுள்ளது. அதன் நோக்கம், \'வரைபடத்தின்\' மூலமாக பாலின் அடையாளத்தின் பல பகுதிகளுக்கு வழிகாட்டல் வழங்கி தனித்த பயணங்களுக்கு மக்களை வழிகாட்டுவதாகும். மிகவும் தற்போதைய மற்றும் சரியான தகவல்களுக்கு நிஜ தளத்தை பார்வையிடுவதற்கை நல்லாக கேட்டுக்கொள்ளுகிறோம்."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"மாறிவாழ்க்கை குடும்பங்கள்","description":"மாறிவாழ்க்கை குடும்பங்கள் நம்பிக்கையை ஊக்கப்படுத்தி, மேலும் அறிவை அதிகரிப்பதற்கும், மாறிய பாலினத்தையும் பாலின வேறுபாடுகளையும் அடையாளம் காணும் குழந்தைகளுக்கு ஆதரவு வழியை உருவாக்கும். ஆவணங்களை வழங்குவதற்கும், நிகழ்வுகளை ஏற்பாடு செய்வதற்கும், குடும்பங்களை ஆதரவு குழுக்களுக்கு இணைக்கும் ஆணைகளை இணைக்கின்றோம்."}]')}}]);